    return ( 
        <form>
            <label>Name :</label>
            <input type="text" name="name"/><br></br>
            <label>NRC :</label>
            <input type="text" name="nrc"/><br></br>
            <label>Gender</label>
            <input type="checkbox"/><br></br>
            <label>Major</label>
            <input type="radio"/><br></br>
            <label>Academic Year</label>

        </form>
     );
}

